import React from "react";
import logo from '../../src/logo.svg';


export const LandingPage = () => {
  return (
    <div>
      <h1>Landing Page here. All the sword fighting.</h1>
      <img src={logo} className="App-logo" alt="logo" />
    </div>
    
    )
}
